import React from "react";
import Navbar from './navbar';
import "../styles/sass/header.css";
import appleHeadphones from '../resource/apple-headphones.png';
import brushboxNew from '../resource/brushbox-new.png';
import coffeeCup from '../resource/coffee-cup.png';
import iphoneNew from '../resource/iphone-new.png';
import mbpNew from '../resource/mbp-new.png';
import padNew from '../resource/pad-new.png';

class Header extends React.Component {
    componentDidMount() {
        this.props.fetchData("header.php")
        var brushboxNewLeft=document.getElementsByClassName("brushboxNew")[0].style.left;
        var appleHeadphonesBottom=document.getElementsByClassName("appleHeadphones")[0].style.bottom;
        var iphoneNewLeft=document.getElementsByClassName("iphoneNew")[0].style.left;
        var coffeeCupRight=document.getElementsByClassName("coffeeCup")[0].style.right;
        setTimeout(()=>{
            this.setState({brushboxNewStyle:{brushboxNewLeft}})
            this.setState({iphoneNewStyle:{iphoneNewLeft}})
            this.setState({appleHeadphonesStyle:{appleHeadphonesBottom}})
            this.setState({coffeeCupStyle:{coffeeCupRight}})
        },800)

    }
state ={
    brushboxNewStyle:{left:"-235px"},
    appleHeadphonesStyle:{bottom:"-200px"},
    coffeeCupStyle:{right:"219px"},
    iphoneNewStyle:{left:"-200px"},
    mbpNewStyle:{left:""},
    padNewStyle:{left:""}
}
    render() {
        return (
            <div className="header" id="header">
                <Navbar/>
                <div className="sliderContent">
                    <div className="headerText">
                        <h1>{this.props.header.header?this.props.header.header.h1:""}</h1>
                        <h5>{this.props.header.header?this.props.header.header.h5:""}</h5>
                    </div>
                    <img style={this.state.brushboxNewStyle} className="brushboxNew" src={brushboxNew} alt="brushbox-new"/>
                    <img style={this.state.appleHeadphonesStyle} className="appleHeadphones" src={appleHeadphones} alt="apple-headphones"/>
                    <img style={this.state.coffeeCupStyle} className="coffeeCup" src={coffeeCup} alt="coffee-cup"/>
                    <img style={this.state.iphoneNewStyle} className="iphoneNew" src={iphoneNew} alt="iphone-new"/>
                    <img className="mbpNew" src={mbpNew} alt="mbp-new"/>
                    <img className="padNew" src={padNew} alt="pad-new"/>
                </div>
            </div>
        )

    }

}

export default Header
